import React from 'react';
import '../../App.css';

const Header = () => {
  return (
    <div className="Header">
      <div className="mallname">
        ABC MALL
      </div>
      <div className="buttons">
        <button className="btn loginButton">
          <a href="/login">Login/Register</a>
        </button>
      </div>
    </div>
  );
};

export default Header;
